import React, { Component } from "react";
import AndroidImg from "./android.png";
import AppleImg from "./apple.png";
import Demo from "./demo.png";

export class Dow extends Component {
  render() {
    return (
        <div class="container">
          <div class="row">
          <div class="home-content tonic-app-section">
              <h2 class="font-galano-md">Get the best of Tonic in one App!</h2>
              <p class="font-light-grey m-t-md m-b-md"></p>
              <p>Have a health need? Tonic brings you 21st century care to your fingertips.</p>
              <p></p>
              <ul class="app-benefits">
              <li><span>Save money</span></li>
              <li><span>Save time</span></li>
              <li><span>Get access to the best</span></li>
              </ul>
              <p></p><p></p> 
              <a href="https://play.google.com/store/apps/details?id=com.telenorhealth.tonicapp">
              <img src={AndroidImg} 
              alt=""  /></a> 
              <a href="https://itunes.apple.com/gb/app/tonic-telenor-health-as/id1287373313">
              <img src={AppleImg} alt=""  />
              </a>
          </div>
          <div className></div>
            <div class="col-sm">
              <img src={Demo} alt="Italian Trulli" />
            </div>
          </div>
      </div>);
  }
}

export default Dow;
